import React, { useState } from "react";
import NavBar from "./component/navbar";

const MonitorPage = () => {
    const [showNavBar, setShowNavBar] = useState(false);

    return (
        <div>
            <button onClick={() => setShowNavBar(!showNavBar)}>
                Toggle Navigation
            </button>
            {showNavBar && <NavBar />}
        </div>
    );
};

export default MonitorPage;
